description:
Annie Oakley

History Documentary hosted by Laura Linney, published by PBS broadcasted as part of PBS American Experience series in 2006 - English narration


Information
------------------------------

Described as &quot;the greatest woman rifle shot the world has ever produced,&quot; Annie Oakley thrilled audiences of Buffalo Bill's Wild West Show with her daring shooting feats. Over time she became an American legend. But that legend had little to do with the real Annie Oakley. This probing AMERICAN EXPERIENCE production examines the dramatic life of a uniquely American icon whose complex character manifested many of the paradoxes of the nation.

